import React from "react";
import RecipeReviewCard from "../../Components/Card/Card";

const Team = () => {
  return (
    <div>
      {partners.map((partner) => {
        <RecipeReviewCard dataObj={partner} />;
      })}
    </div>
  );
};

export default Team;
